import React from "react";

const AdMaxSidebar = () => {
    const adHTML = `
        <!DOCTYPE html>
        <html lang="ja">
        <head>
            <meta charset="UTF-8">
            <title>AdMax Sidebar Ad</title>
        </head>
        <body>
            <script src="https://adm.shinobi.jp/s/ed30413d8ef4760b707dc1168527491d"></script>
        </body>
        </html>
    `;

    return (
        <div style={{
            position: "fixed",
            top: "100px",
            right: "10px",
            width: "160px",
            height: "600px",
            backgroundColor: "#f4f4f4",
            border: "1px solid #ccc",
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
        }}>
            <iframe
                srcDoc={adHTML}
                width="160"
                height="600"
                style={{ border: "none" }}
                title="AdMax Sidebar"
            ></iframe>
        </div>
    );
};

export default AdMaxSidebar;
